const canvas = document.querySelector('canvas');
const c = canvas.getContext('2d');
canvas.width = 1024;
canvas.height = 768;

const menuOverlay = document.createElement('div');
menuOverlay.id = 'menuOverlay';
menuOverlay.style.position = 'fixed';
menuOverlay.style.top = '0';
menuOverlay.style.left = '0';
menuOverlay.style.width = '100%';
menuOverlay.style.height = '100%';
menuOverlay.style.backgroundColor = 'rgba(0, 0, 0, 0.8)';
menuOverlay.style.display = 'flex';
menuOverlay.style.flexDirection = 'column';
menuOverlay.style.justifyContent = 'center';
menuOverlay.style.alignItems = 'center';
menuOverlay.style.zIndex = '1000';

const gameTitle = document.createElement('h1');
gameTitle.innerText = 'Enjoy the Game';
gameTitle.style.color = 'white';
gameTitle.style.marginBottom = '20px';

const rules = document.createElement('div');
rules.style.color = 'white';
rules.style.textAlign = 'center';
rules.style.marginBottom = '20px';
rules.innerHTML = `
    <p>- Use W, A, S, D to move and press Enter to talk to characters.</p>
    <p>- Follow the yellow path in case you feel lost.</p>
`;

const playButton = document.createElement('button');
playButton.innerText = 'Play';
playButton.style.padding = '20px 40px';
playButton.style.fontSize = '24px';
playButton.style.cursor = 'pointer';
playButton.style.border = 'none';
playButton.style.borderRadius = '10px';
playButton.style.backgroundColor = '#4CAF50';
playButton.style.color = 'white';
playButton.style.boxShadow = '0 4px 6px rgba(0, 0, 0, 0.3)';

menuOverlay.appendChild(gameTitle);
menuOverlay.appendChild(rules);
menuOverlay.appendChild(playButton);
document.body.appendChild(menuOverlay);

// Game starts paused
let paused = true;

// Play button functionality
playButton.addEventListener('click', () => {
    paused = false; // Unpause the game
    menuOverlay.style.display = 'none'; // Hide the menu
});


